    if (num % divisor === 0) {
      return false;
    }
    return iter(divisor + 1);
  };
  return iter(2);
};
const makeGame = () => {
  const question = getRandomInt(firstNum, lim);
  const answer = isPrime(question) ? 'yes' : 'no';
  return [String(question), answer];
};
